/**
 * @file Contains the action generators
 * @author Edward Gonzalez
 */

import * as ActionTypes from '../constants/ActionTypes';
import * as AbortReasons from '../constants/AbortReasons';
import * as WithdrawFailReasons from '../constants/WithdrawFailReasons';

/*
 * @ignore
 */
const AbortReasonsList = Object.keys(AbortReasons);

/*
 * @ignore
 */
const WithdrawFailReasonsList = Object.keys(WithdrawFailReasons);

/**
 * Executes when the card has been inserted by the user
 * @return {Object} The generated action
 * @property {String} type The type constant as defined in ActionTypes
 */
export const cardInserted = ()=>{
	return {'type':ActionTypes.CARD_INSERTED}
}

/**
 * Executes when the card has been processed by the ATM
 * @return {Object} The generated action
 * @property {String} type The type constant as defined in ActionTypes
 */
export const cardProcessed = ()=>{
	return {'type':ActionTypes.CARD_PROCESSED}
}

/**
 * Executes when the pin has been inserted by the user
 * @return {Object} The generated action
 * @property {String} type The type constant as defined in ActionTypes
 * @property {String} payload The inserted pin
 */
export const pinInserted = (pin)=>{
	if (!pin || typeof(pin) !== "string"){
		throw new Error('cannot execute action pinInserted without a valid pin',pin);
	}
	return {'type':ActionTypes.PIN_INSERTED,'payload':pin};
}

/**
 * Executes when the pin processed is valid
 * @return {Object} The generated action
 * @property {String} type The type constant as defined in ActionTypes
 */
export const pinProcessedValid = ()=>{
	return {'type':ActionTypes.PIN_PROCESSED_VALID};
}

/**
 * Executes when the pin processed is not valid
 * @return {Object} The generated action
 * @property {String} type The type constant as defined in ActionTypes
 */
export const pinProcessedInvalid = ()=>{
	return {'type':ActionTypes.PIN_PROCESSED_INVALID};
}

/**
 * Executes when the user specifies that he wants to withdraw some money
 * @return {Object} The generated action
 * @property {String} type The type constant as defined in ActionTypes
 */
export const withdraw = (amount)=>{
	if (!amount || typeof(amount) !== "number" || amount < 0){
		throw new Error('cannot execute action withdraw without a valid amount',amount);
	}
	return {'type':ActionTypes.WITHDRAW,'payload':amount};
}

/**
 * Executes when the withdraw was suscesful
 * @return {Object} The generated action
 * @property {String} type The type constant as defined in ActionTypes
 */
export const withdrawSuscesful = ()=>{
	return {'type':ActionTypes.WITHDRAW_SUSCESFUL};
}

/**
 * Executes when the withdraw has failed
 * @return {Object} The generated action
 * @property {String} type The type constant as defined in ActionTypes
 * @property {String} payload The inserted pin as defined in WithdrawFailReasons
 */
export const withdrawFailed = (reason)=>{
	if (WithdrawFailReasonsList.indexOf(reason) === -1){
		throw new Error('cannot execute action withdrawFailed without a valid reason',reason,'from',WithdrawFailReasonsList);
	}
	return {'type':ActionTypes.WITHDRAW_SUSCESFUL,'payload':reason};
}

/**
 * Executes when the money is delivered
 * @return {Object} The generated action
 * @property {String} type The type constant as defined in ActionTypes
 */
export const moneyDelivered = ()=>{
	return {'type':ActionTypes.MONEY_DELIVERED};
}

/**
 * Executes when the user takes the card and the money
 * @return {Object} The generated action
 * @property {String} type The type constant as defined in ActionTypes
 */
export const cardAndMoneyTaken = ()=>{
	return {'type':ActionTypes.CARD_AND_MONEY_TAKEN};
}

/**
 * Executes when the ATM is done
 * @return {Object} The generated action
 * @property {String} type The type constant as defined in ActionTypes
 */
export const finished = ()=>{
	return {'type':ActionTypes.FINISHED};
}

/**
 * Executes when the ATM aborts for some reason
 * @return {Object} The generated action
 * @property {String} type The type constant as defined in ActionTypes
 * @property {String} payload The reason why it aborts as defined in AbortReasons
 */
export const performAbort = (reason)=>{
	if (AbortReasonsList.indexOf(reason) === -1){
		throw new Error('cannot execute action performAbort without a valid reason',reason,'from',AbortReasonsList);
	}
	return {'type':ActionTypes.PERFORM_ABORT,'payload':reason};
}

/**
 * Executes when the ATM completes the abort process
 * @return {Object} The generated action
 * @property {String} type The type constant as defined in ActionTypes
 */
export const completeAbort = ()=>{
	return {'type':ActionTypes.COMPLETE_ABORT};
}

/**
 * @file Contains the action generators
 * @author Edward Gonzalez
 */

/**
 * When the user tried too much on an invalid pin
 */
export const TOO_MANY_FAILED_PIN_ATTEMPTS = 'TOO_MANY_FAILED_PIN_ATTEMPTS';

/**
 * When the user tried too much to withdraw on the excessive amount
 */
export const TOO_MANY_FAILED_WITHDRAW_ATTEMPTS = 'TOO_MANY_FAILED_WITHDRAW_ATTEMPTS';

/**
 * When the user asked more than it had
 */
export const NOT_ENOUGH_FUNDS = 'NOT_ENOUGH_FUNDS';

/**
 * When the user cancels on its own
 */
export const USER_CANCELS = 'USER_CANCELS';

/**
 * @file Contains the action types constants
 * @author Edward Gonzalez
 */

/**
 * The card has been inserted by the user
 */
export const CARD_INSERTED = 'CARD_INSERTED';

/**
 * The card has been processed by the ATM
 */
export const CARD_PROCESSED = 'CARD_PROCESSED';

/**
 * The pin has been inserted by the user
 */
export const PIN_INSERTED = 'PIN_INSERTED';

/**
 * The pin is valid
 */
export const PIN_PROCESSED_VALID = 'PIN_PROCESSED_VALID';

/**
 * The pin is invalid
 */
export const PIN_PROCESSED_INVALID = 'PIN_PROCESSED_INVALID';

/**
 * withdraw some money
 */
export const WITHDRAW = 'WITHDRAW';

/**
 * withdraw was suscesful
 */
export const WITHDRAW_SUSCESFUL = 'WITHDRAW_SUSCESFUL';

/**
 * withdraw has failed
 */
export const WITHDRAW_FAILED = 'WITHDRAW_FAILED';

/**
 * money has been delivered
 */
export const MONEY_DELIVERED = 'MONEY_DELIVERED';

/**
 * The user took his card and money
 */
export const CARD_AND_MONEY_TAKEN = 'CARD_AND_MONEY_TAKEN';

/**
 * Process finished
 */
export const FINISHED = 'FINISHED';

/**
 * Trigger an abort
 */
export const PERFORM_ABORT = 'PERFORM_ABORT';

/**
 * Abort has been completed
 */
export const COMPLETE_ABORT = 'COMPLETE_ABORT';

/**
 * @file Contains the ATM states
 * @author Edward Gonzalez
 */

/**
 * The ATM is waiting for the card
 */
export const WAITING_FOR_CARD = 'WAITING_FOR_CARD';

/**
 * The ATM is processing the card
 */
export const PROCESSING_CARD = 'PROCESSING_CARD';

/**
 * The ATM is waiting for the pin to be inserted
 */
export const WAITING_FOR_PIN = 'WAITING_FOR_PIN';

/**
 * The ATM is processing the pin
 */
export const PROCESSING_PIN = 'PROCESSING_PIN';

/**
 * The ATM is waiting for the amount to be set
 */
export const WAITING_FOR_AMOUNT = 'WAITING_FOR_AMOUNT';

/**
 * The ATM is processing the amount
 */
export const PROCESSING_AMOUNT = 'PROCESSING_AMOUNT';

/**
 * The ATM is delivering the money
 */
export const DELIVERING = 'DELIVERING';

/**
 * The ATM has delivered the money
 */
export const DELIVERED = 'DELIVERED';

/**
 * The ATM is done with the process and will restart
 */
export const DONE = 'DONE';

/**
 * The ATM is aborting
 */
export const ABORTING = 'ABORTING';

/**
 * @file Contains the reasons why a withdraw action may fail (note that this should allow to try again)
 * @author Edward Gonzalez
 */

/**
 * Specifies that the limit of the transaction size is reached
 */
export const LIMIT_REACHED = 'LIMIT_REACHED';

/**
 * @file Contains the configuration of the ATM
 * @author Edward Gonzalez
 */

/**
 * The maximum times you can retry to input the pin
 */
export const MAX_PIN_TRIES = 3;

/**
 * Right pin number
 */
export const RIGHT_PIN = "1234";

import WaitingForCard from './WaitingForCard';
import ProcessingCard from './ProcessingCard';
import WaitingForPin from './WaitingForPin';
import Aborting from './Aborting';
import ProcessingPin from './ProcessingPin';

export {WaitingForCard,ProcessingCard,WaitingForPin,Aborting,ProcessingPin};

/**
 * @file The entry point for the application, where middlewares are applied and the store is created
 * @author Edward Gonzalez
 */

import React from 'react';
import { render } from 'react-dom';
import { applyMiddleware, createStore } from 'redux';
import { Provider } from 'react-redux';
import App from './containers/App';
import reducer from './reducers';

let store;
if (process.env.NODE_ENV === 'production'){
	store = createStore(reducer);
} else {
	let createLogger = require('redux-logger');
	const logger = createLogger();
	store = createStore(
		reducer,
		applyMiddleware(logger)
	);
}

import './css/index.css';
import './css/colors.css';
import './css/text.css';
import './css/screen.css';
import './css/animations.css';

render(
	<Provider store={store}>
		<App/>
	</Provider>,
	document.getElementById('container')
);

/**
 * @file Contains the abortion reason from the ATM
 * @author Edward Gonzalez
 */

import * as ActionTypes from '../constants/ActionTypes';

/**
 * This is the reducer for the abortion reason of the application
 *
 * @param {String} state The current state, as provided by the store
 * @param {Object} action The action that is executed
 */
export default function abortReason(state = null, action){
	switch (action.type){
		case ActionTypes.PERFORM_ABORT:
			return action.payload;
		case ActionTypes.COMPLETE_ABORT:
			return null;
		default:
			return state;
	}
}

/**
 * @file Includes all the reducers that the application needs in order to execute
 * @author Edward Gonzalez
 */

import { combineReducers } from 'redux';
import state from './state';
import pin from './pin';
import pinAttempts from './pinAttempts';
import withdrawAttempts from './withdrawAttempts';
import abortReason from './abortReason';
import withdrawFailReason from './withdrawFailReason';

/**
 * This is the root reducer that will populate the store
 */
const rootReducer = combineReducers({state,pinAttempts,withdrawAttempts,abortReason,withdrawFailReason,pin});

export default rootReducer;

/**
 * @file Contains information about the current pin to use for processing
 * @author Edward Gonzalez
 */

import * as ActionTypes from '../constants/ActionTypes';

/**
 * This is the state reducer that represents the current pin that was
 * set into the ATM and it holded only for a brief time until is valid or invalid
 *
 * @param {String} state The current state, as provided by the store
 * @param {Object} action The action that is executed
 */
export default function pin(state = null, action){
	switch (action.type){
		case ActionTypes.PIN_INSERTED:
			return action.payload;
		case ActionTypes.PIN_PROCESSED_VALID:
		case ActionTypes.PIN_PROCESSED_INVALID:
		case ActionTypes.COMPLETE_ABORT:
		case ActionTypes.PERFORM_ABORT:
			return null;
		default:
			return state;
	}
}

/**
 * @file Contains the state reducer for the ATM pin attempts
 * @author Edward Gonzalez
 */

import * as ActionTypes from '../constants/ActionTypes';

/**
 * This is the main state reducer and represents the amount of times the user
 * has attempted to put a pin in the ATM
 * The number will reset once the ATM finishes or aborts
 *
 * @param {Number} state The current state, as provided by the store
 * @param {Object} action The action that is executed
 */
export default function pinAttempts(state = 0, action){
	switch (action.type){
		case ActionTypes.PIN_PROCESSED_VALID:
		case ActionTypes.PIN_PROCESSED_INVALID:
			return state + 1;
		case ActionTypes.FINISHED:
		case ActionTypes.COMPLETE_ABORT:
			return 0;
		default:
			return state;
	}
}

/**
 * @file Contains the state reducer for the ATM current state
 * @author Edward Gonzalez
 */

import * as States from '../constants/States';
import * as ActionTypes from '../constants/ActionTypes';

/**
 * This is the main state reducer and represents the main state of the application
 * it represents in which situation the ATM is
 *
 * @param {String} state The current state, as provided by the store
 * @param {Object} action The action that is executed
 */
export default function state(state = States.WAITING_FOR_CARD, action){
	switch (action.type){
		case ActionTypes.CARD_INSERTED:
			return States.PROCESSING_CARD;
		case ActionTypes.CARD_PROCESSED:
			return States.WAITING_FOR_PIN;
		case ActionTypes.PIN_INSERTED:
			return States.PROCESSING_PIN;
		case ActionTypes.PIN_PROCESSED_VALID:
			return States.WAITING_FOR_AMOUNT;
		case ActionTypes.PIN_PROCESSED_INVALID:
			return States.WAITING_FOR_PIN;
		case ActionTypes.WITHDRAW:
			return States.PROCESSING_AMOUNT;
		case ActionTypes.WITHDRAW_SUSCESFUL:
			return States.DELIVERING;
		case ActionTypes.WITHDRAW_FAILED:
			return States.WAITING_FOR_AMOUNT;
		case ActionTypes.MONEY_DELIVERED:
			return States.DELIVERED;
		case ActionTypes.CARD_AND_MONEY_TAKEN:
			return States.DONE;
		case ActionTypes.FINISHED:
			return States.WAITING_FOR_CARD;
		case ActionTypes.PERFORM_ABORT:
			return States.ABORTING;
		case ActionTypes.COMPLETE_ABORT:
			return States.WAITING_FOR_CARD;
		default:
			return States.WAITING_FOR_CARD;
	}
}

/**
 * @file Contains the state reducer for the ATM withdraw attempts
 * @author Edward Gonzalez
 */

import * as ActionTypes from '../constants/ActionTypes';

/**
 * This is the reducer represents the amount of times the user
 * has attempted to withdraw some money
 * The number will reset once the ATM finishes or aborts
 *
 * @param {Number} state The current state, as provided by the store
 * @param {Object} action The action that is executed
 */
export default function withdrawAttempts(state = 0, action){
	switch (action.type){
		case ActionTypes.WITHDRAW_SUSCESFUL:
		case ActionTypes.WITHDRAW_FAILED:
			return state + 1;
		case ActionTypes.FINISHED:
		case ActionTypes.COMPLETE_ABORT:
			return 0;
		default:
			return state;
	}
}

/**
 * @file Contains the state reducer for the ATM withdraw failed reason
 * @author Edward Gonzalez
 */

import * as ActionTypes from '../constants/ActionTypes';

/**
 * This reducer represents the reason why the ATM failed to withdraw some money
 *
 * @param {String} state The current state, as provided by the store
 * @param {Object} action The action that is executed
 */
export default function withdrawFailReason(state = null, action){
	switch (action.type){
		case ActionTypes.WITHDRAW_FAILED:
			return action.payload;
		case ActionTypes.WITHDRAW:
		case ActionTypes.FINISHED:
		case ActionTypes.COMPLETE_ABORT:
			return null;
		default:
			return state;
	}
}
